INSERT INTO `about_us` (`id`, `title_ar`, `title_en`, `description_ar`, `description_an`, `image_url`, `extra_info`, `created_at`, `updated_at`) VALUES
(1, 'who we are   ?', 'who we are  ?', 'At SyncN, we’re more than just an IoT platform—we’re innovators on a mission to redefine smart living. Our journey began with a single idea: to create technology that doesn’t just connect devices but connects people to the life they’ve always imagined.\r\nFrom our roots in the Arab world, we’ve grown into a leading name in IoT, offering cutting-edge solutions that blend seamlessly into daily life. Whether it’s smart homes, secure environments, or energy-efficient systems, SyncN empowers individuals and businesses to take control with ease.', 'At SyncN, we’re more than just an IoT platform—we’re innovators on a mission to redefine smart living. Our journey began with a single idea: to create technology that doesn’t just connect devices but connects people to the life they’ve always imagined.\r\nFrom our roots in the Arab world, we’ve grown into a leading name in IoT, offering cutting-edge solutions that blend seamlessly into daily life. Whether it’s smart homes, secure environments, or energy-efficient systems, SyncN empowers individuals and businesses to take control with ease.', 'about-us/February2025/QVdNN5qAIvWerV8Wtvmd.png', NULL, '2024-12-17 14:39:00', '2025-02-03 08:07:59');
