(1, 1, 'Enhanced Device Control', 'Enhanced Device Control', '2024-12-08 22:01:00', '2025-01-29 12:37:52', 'features/December2024/MSlU1KNnqH8WdcZlXcoE.png', 'monitor connected devices in real-time'),
