INSERT INTO `featurescategories` (`id`, `title_ar`, `title_en`, `desc_ar`, `desc_en`, `created_at`, `updated_at`) VALUES
(1, 'Build Your Smart Home Experience with Ease', 'Build Your Smart Home Experience with Ease', 'Build Your Smart Home Experience with Ease\r\nEffortless Customization\r\nTake full control of your IoT ecosystem with our no-code UI builder. Create a branded mobile app for managing your smart home devices without any coding expertise. With our drag-and-drop tools, you can design, customize, and publish your app on the App Store and Google Play in no time.', 'Build Your Smart Home Experience with Ease\r\nEffortless Customization\r\nTake full control of your IoT ecosystem with our no-code UI builder. Create a branded mobile app for managing your smart home devices without any coding expertise. With our drag-and-drop tools, you can design, customize, and publish your app on the App Store and Google Play in no time.', '2024-12-08 21:49:00', '2025-01-30 11:05:58');
INSERT INTO `features_hero_sections` (`id`, `title`, `desc`, `image`, `created_at`, `updated_at`, `url`, `url_title`) VALUES
(1, 'Create customer-ready IoT apps with no code', '<ul class=\"list-2 product-page__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Drag-n-drop mobile app builder</li>\r\n<li class=\"product-page__list__item\">Over 60 GUI elements to visualize data and control devices</li>\r\n<li class=\"product-page__list__item\">Alerts, notifications</li>\r\n<li class=\"product-page__list__item\">Automations</li>\r\n<li class=\"product-page__list__item\">Nested app pages</li>\r\n<li class=\"product-page__list__item\">Can be branded and published</li>\r\n</ul>', 'features-hero-sections/April2025/uOgAIzQSKczMLL3D23r9.webp', '2025-04-25 14:54:00', '2025-04-25 14:57:21', NULL, 'More on IoT app builder'),
(2, 'Easily connect supported devices', '<ul class=\"list-2 product-page__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">10 lines of code that connect your hardware to Blynk.Cloud</li>\r\n<li class=\"product-page__list__item\">400 boards supported by Blynk library</li>\r\n<li class=\"product-page__list__item\">WiFi, Ethernet, Cellular (GSM, 2G, 3G, 4G, LTE), LoRaWAN connectivity supported</li>\r\n<li class=\"product-page__list__item\">Flexible and simple firmware API to handle events, metadata, time and location, persistent automations</li>\r\n</ul>', 'features-hero-sections/April2025/eEzXMYHVJjS1TOfn78va.webp', '2025-04-25 14:56:00', '2025-04-25 14:57:40', NULL, 'More on connecting hardware'),
(3, 'Leverage industry leading device provisioning', '<ul class=\"list-2 product-page__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">BLE-assisted device provisioning using the app or web Console</li>\r\n<li class=\"product-page__list__item\">WiFi AP-based provisioning for devices without BLE support</li>\r\n<li class=\"product-page__list__item\">Support for Production Line provisioning</li>\r\n<li class=\"product-page__list__item\">Network manager for WiFi, Ethernet and cellular</li>\r\n</ul>', 'features-hero-sections/April2025/zlWg5BrMDdqGyiSTmRYc.webp', '2025-04-25 14:59:01', '2025-04-25 14:59:01', NULL, 'More on device provisioning'),
(4, 'Set up multiple devices with product templates', '<ul class=\"list-2 product-page__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Store all device configurations in one Template</li>\r\n<li class=\"product-page__list__item\">Manage or update settings for thousands of devices of the same type</li>\r\n<li class=\"product-page__list__item\">Easily update web and mobile dashboard UI</li>\r\n<li class=\"product-page__list__item\">Set up which device events should be tracked</li>\r\n<li class=\"product-page__list__item\">Configure automation capabilities for the product including push notifications and alerts</li>\r\n</ul>', 'features-hero-sections/April2025/mTPNq6KotqliDnUrBUxf.webp', '2025-04-25 15:00:50', '2025-04-25 15:00:50', NULL, 'More on product templates'),
(5, 'Stream and store data in the cloud', '<ul class=\"list-2 product-page__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Secure and scalable server infrastructure binding all the platform components together</li>\r\n<li class=\"product-page__list__item\">Send and receive data real-time or in intervals, in batches</li>\r\n<li class=\"product-page__list__item\">Store and visualize real-time historical data</li>\r\n<li class=\"product-page__list__item\">Cloud hosting included</li>\r\n<li class=\"product-page__list__item\">HTTPs API to connect to your other systems</li>\r\n<li class=\"product-page__list__item\">Private servers available with Business Plan</li>\r\n<li class=\"product-page__list__item\">SOC2 compliant</li>\r\n</ul>', 'features-hero-sections/April2025/FoYXh3TWXZe4Wgibc1zW.webp', '2025-04-25 15:02:23', '2025-04-25 15:02:23', NULL, 'More on Blynk HTTPs API');
