INSERT INTO `sectionfour_hero_sections` (`id`, `title`, `desc`, `btn_one_title`, `btn_two_title`, `btn_one_url`, `btn_two_url`, `created_at`, `updated_at`) VALUES
(1, 'Smart Solutions, Tailored for You', 'We provide end-to-end smart home and IoT services—from intelligent installations to powerful software integrations. Whether you’re upgrading your home or building a connected system from scratch, we turn ideas into smart living experiences.', 'Explore Our Services', 'Request a Free Consultation', 'https://sync-n.com/Features', 'https://sync-n.com/contactUs', '2025-04-17 13:34:00', '2025-04-22 12:28:42');
INSERT INTO `sectionones` (`id`, `title_ar`, `title_en`, `desc_ar`, `desc_en`, `image`, `created_at`, `updated_at`) VALUES
(1, 'In Sync, In Control', 'In Sync, In Control', 'At SyncN, we bring harmony to your smart living experience. Our technology connects your spaces, devices, and lifestyle into one intelligent ecosystem— effortlessly', 'At SyncN, we bring harmony to your smart living experience. Our technology connects your spaces, devices, and lifestyle into one intelligent ecosystem— effortlessly', 'sectionones/February2025/itFPDFXT31pvPUdhP66w.png', '2024-12-19 12:01:00', '2025-02-03 12:00:05');
INSERT INTO `sectionone_hero_sections` (`id`, `title`, `description`, `image`, `created_at`, `updated_at`, `btn_one`, `btn_two`, `btn_one_url`, `btn_two_url`) VALUES
(1, 'Revolutionize Your Living with Smart Home Tech', 'Experience the future of comfort, security, and control. Our smart home solutions seamlessly blend cutting-edge hardware with intelligent software to create homes that think with you.', 'sectionone-hero-sections/April2025/nAaQdhIgveOQASEtLNOm.jpg', '2025-04-16 13:04:00', '2025-04-22 12:08:56', 'Book Your Free Consultation', 'Sign Up Free', 'https://sync-n.com/contactUs', 'https://sync-n.com/register');
