INSERT INTO `sectionthree_hero_sections` (`id`, `title`, `desc`, `image`, `btn_one_title`, `btn_two_title`, `btn_one_url`, `btn_two_url`, `created_at`, `updated_at`) VALUES
(1, 'Protect What Matters Most', 'Our intelligent security solutions combine cutting-edge hardware with real-time monitoring and automation. From smart cameras and motion sensors to door locks and alarm systems—everything is connected and controlled in one place.', 'sectionthree-hero-sections/April2025/9V1UwqfHW93ksrAxuyQU.jpg', NULL, NULL, NULL, NULL, NULL, '2025-04-22 13:52:40');
INSERT INTO `sectiontwos` (`id`, `title_en`, `title_ar`, `hint_ar`, `hint_en`, `desc_ar`, `desc_en`, `image`, `created_at`, `updated_at`, `key`) VALUES
(1, 'Create Smart, Live Smart', 'Create Smart, Live Smart', 'Make it smart', 'Make it smart', 'Making your home smarter doesn’t have to be complicated, costly, or time-consuming. With SyncN, you make the decisions, and we handle the rest—effortlessly turning your vision into a connected reality.\r\n\r\nVisual brief: \r\n\r\nA modern, cozy home environment where smart devices (lights, appliances, and security features) are seamlessly connected and controlled with ease.', 'Making your home smarter doesn’t have to be complicated, costly, or time-consuming. With SyncN, you make the decisions, and we handle the rest—effortlessly turning your vision into a connected reality.\r\n\r\nVisual brief: \r\n\r\nA modern, cozy home environment where smart devices (lights, appliances, and security features) are seamlessly connected and controlled with ease.', 'sectiontwos/February2025/GQIEoNuBV3EwuM5hJJlI.jpg', '2024-12-19 12:35:00', '2025-02-03 08:14:46', 'part_two'),
(2, 'SyncN Platform', 'SyncN Platform', 'Make it Simple', 'Make it Simple', 'At SyncN, we take the complexity out of IoT. From prototype to production, our platform empowers you to design, deploy, and manage your smart solutions effortlessly. Whether you’re building high-quality mobile apps or managing cloud services, SyncN’s tools simplify every stage—ensuring enterprise-level security and seamless performance.', 'At SyncN, we take the complexity out of IoT. From prototype to production, our platform empowers you to design, deploy, and manage your smart solutions effortlessly. Whether you’re building high-quality mobile apps or managing cloud services, SyncN’s tools simplify every stage—ensuring enterprise-level security and seamless performance.', 'sectiontwos/February2025/UfK3RYscxUihZdb9iQlY.jpg', '2024-12-19 12:36:00', '2025-02-19 14:21:19', 'part_one');
INSERT INTO `sectiontwo_hero_sections` (`id`, `title`, `subtitle`, `description`, `created_at`, `updated_at`) VALUES
(1, 'All-in-One Access with Our App & Dashboard', 'Control, monitor, and automate your home—anytime, anywhere.', 'Our powerful mobile app and web-based dashboard give you complete command of your smart home system. Whether you\'re managing a single property or multiple sites, you\'ll have full visibility and control at your fingertips.', '2025-04-16 14:25:00', '2025-04-22 11:35:06');
INSERT INTO `sectiont_two_features_sections` (`id`, `title`, `sub_title`, `image`, `desc`, `created_at`, `updated_at`, `url`, `url_title`) VALUES
(1, 'White label solution', 'Blynk Enterprise', 'sectiont-two-features-sections/April2025/LJFkKMWBhXPakA0umrmo.webp', '<ul class=\"list-2 product-card__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Prototype and launch with up to 500 devices</li>\r\n</ul>\r\n<ul>\r\n<li>Blynk App and Blynk Console set up for your business&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>Connect to general Blynk Cloud</li>\r\n</ul>\r\n<ul class=\"list-2 product-card__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Access to technical support</li>\r\n</ul>', '2025-04-27 08:50:00', '2025-04-27 11:53:32', NULL, 'Contact sales'),
(2, 'Launch with Blynk apps', 'Blynk PRO', 'sectiont-two-features-sections/April2025/zwpGyXMhbIEUpyIP5wDd.webp', '<ul class=\"list-2 product-card__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Prototype and launch with up to 500 devices</li>\r\n</ul>\r\n<ul>\r\n<li>Blynk App and Blynk Console set up for your business&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>Connect to general Blynk Cloud</li>\r\n</ul>\r\n<ul class=\"list-2 product-card__list\" role=\"list\">\r\n<li class=\"product-page__list__item\">Access to technical support</li>\r\n</ul>', '2025-04-27 09:02:00', '2025-04-27 10:36:50', NULL, 'start now');
INSERT INTO `section_four_blocks` (`id`, `section_four_hero_id`, `title`, `desc`, `image`, `created_at`, `updated_at`) VALUES
(1, 1, 'Smart Home Installation', 'We design and install fully integrated smart home systems—from lighting and climate control to security, curtains, and entertainment.', NULL, '2025-04-17 13:52:00', '2025-04-22 12:17:45'),
(2, 1, 'Custom IoT Software Development', 'Our team builds tailored IoT applications that power your smart devices—from mobile apps to backend cloud systems.', NULL, '2025-04-17 13:52:00', '2025-04-22 12:18:12'),
(3, 1, 'Device Integration & Automation', 'Connect all your smart devices into one unified system.', NULL, '2025-04-17 13:53:00', '2025-04-22 12:19:58'),
(4, 1, 'Maintenance & Support', 'Smart homes need smart support. We offer regular maintenance, remote troubleshooting, firmware updates.', NULL, '2025-04-17 13:53:00', '2025-04-22 12:19:26');
INSERT INTO `section_two_blocks` (`id`, `section_two_hero_id`, `title`, `desc`, `created_at`, `updated_at`, `image`, `btn_one_title`, `btn_two_title`, `btn_one_url`, `btn_two_url`, `subtitle`) VALUES
(1, 1, 'Full Visibility, Full Control', 'For those who want deeper insights and total system management, our web dashboard delivers advanced control in a sleek and powerful interface—ideal for property managers, developers, or tech-savvy users.', '2025-04-17 11:15:00', '2025-04-22 11:48:20', 'section-two-blocks/April2025/0AoAR2Lq8TtH1DqTrIaQ.png', NULL, NULL, NULL, NULL, 'Dashboard'),
(2, 1, 'Your Home, In Your Pocket', 'Control every aspect of your smart home, no matter where you are. Our mobile app turns your smartphone into a powerful remote for your lights, locks, thermostat, cameras, and more—all in a clean, user-friendly interface.', '2025-04-18 22:23:00', '2025-04-22 11:51:02', 'section-two-blocks/April2025/BfkYDwuEcjMEgr7y3uNa.png', 'learn more', 'Request a  demo', NULL, NULL, 'Mobile App');
